function GetEpisode(ShowID, setEpisodios){
    fetch(`https://api.spreaker.com/v2/shows/` +
                        ShowID +
                        `/episodes`
    )
    .then((response)=>response.json())	
    .then((episodes) => {
        console.log(episodes.response)
        setPodcast(episodes.response)
    })
}

export default GetEpisode
